import React, {Component} from "react"

class App extends Component {
    constructor() {
        super()
        this.state = {
            favColor: "blue",
            Gender: ""
        }
        this.handleChange = this.handleChange.bind(this)
    }

    handleChange(event) {
        const {name, value} = event.target
        this.setState({
            [name]: value
        })
    }

    render() {
        return (
            <form>
                <label for="Gender">How do you identify yourself: </label>
                <input type="Button" id="Gender" value="Man"> </input>
                <input type="Button" id="Gender" value="Woman"> </input>
            </form>
        )
    }
}

export default App
